import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

function MyApp() {
    return (
        <ul>
            <li>Gael Monfils</li>
            <li>Roger Federer</li>
            <li>Kei Nishikori</li>
        </ul>
    )
}

function MyInfo() {
    return (
        <div>
            <h1>Victor Kuan's favorite tennis players</h1>
            <p>Victor Kuan is a terrible tennis player, but he sure does love watching good tennis players go at it, lol.</p>
            <p>Here are Victor Kuan's favorite dudes. Esketit.</p>
        </div>
    )
}
// var element = React.createElement('h1', { className: 'greeting' }, 'Hello, world!');
// ReactDOM.render(<div><h1>Hewwo Worle</h1><p>It me, Wicteur.</p></div>, document.getElementById('root'));
ReactDOM.render(<MyInfo />, document.getElementById("root"));
// ReactDOM.render(<MyApp />, document.getElementById("root"));








